import { Form, Input, InputNumber, Button } from 'antd';
import { DatePicker } from 'antd';
import { Layout } from 'antd';
import { Typography } from 'antd';

const { Title } = Typography;

const layout = {
    labelCol: { span: 8 },
    wrapperCol: { span: 10 },
  };

function onChange(date, dateString) {
console.log(date, dateString);
}
const validateMessages = {
    required: '${label} is required!',
    types: {
      number: '${label} is not a valid number!',
      email: '${label} is not a valid email!',
    },
    number: {
      range: '${label} must be between ${min} and ${max}',
    },
  };

  const TaoNVQLK = () => {
    return (     
        <Layout>
            <div>
                <Title level="2" align="center">Thêm Nhân Viên Quản Lý Kho</Title>
            </div>
            <div>
            <Form {...layout} validateMessages={validateMessages}>
                <Form.Item label="Nhập mã nhân viên" rules={[{ required: true }]}>
                    <Input />
                </Form.Item>     
                <Form.Item label="Nhập tên nhân viên" rules={[{ required: true }]}>
                    <Input />
                </Form.Item>    
                <Form.Item name={['user', 'email']} label="Email" rules={[{ type: 'email' }, {required: true}]}>
                    <Input />
                </Form.Item>
                
                <Form.Item label="Ngày sinh" rules={[{ required: true }]}>
                    <DatePicker onChange={onChange} />
                </Form.Item>
                
                <Form.Item wrapperCol={{ ...layout.wrapperCol, offset: 8 }}>
                <Button type="primary" htmlType="submit" size="middle">
                    Xác nhận
                </Button>
                </Form.Item>
            </Form>
            </div>
        </Layout>  
    );
  };
export default TaoNVQLK;
